import React from 'react';
import {Link} from 'react-router-dom';

const sumCategories = props => {
    return (
        <div className="sumObj">
        <Link to="/categories">
          <div>
            <h3>Kategorien</h3>
            <ul className="HomeList">
             <li>Entertainment</li>
             <li>Verkehr</li>
             <li>Haushalt</li>
             <li>Lebensmittel</li>
            </ul>
          </div>
        </Link>
      </div>
    )
}

export default sumCategories;
